import React from 'react';
import './header.component.css';

const Header = (props) => {
    return (
        <div className="nav_bar">
            <ul className="nav_list">
                <li>Home</li>
                <li>Login</li>
                <li>Register</li>
                <li>Profile</li>
                <li>Logout</li>
            </ul>
        </div>
    )
}

export default Header;
